    <script>
      /**
       * @param {number[]} array
       */
      const quickSort = array => {
        if (array.length <= 1) {
          return array;
        }
        const [array1, pivot, array2] = partition(array);
        // return [array1, pivot, array2];

        return [...quickSort(array1), ...pivot, ...quickSort(array2)];
      };

      /**
       * @param {number[]} array
       */
      const partition = array => {
        array = [...array];
        const pivot = array.length - 1;
        const pivotNumber = array[pivot];

        let pIndex = 0;

        for (let i = 0; i < array.length - 1; i++ ) {
          if (array[i] < pivotNumber) {
            // swap 2 items
            const v1 = array[i];
            const v2 = array[pIndex];

            array[i] = v2;
            array[pIndex] = v1;

						pIndex++;
          }
        }

        return [array.slice(0, pIndex), [pivotNumber], array.slice(pIndex, array.length - 1)];
      };

			/**
			 * @param {number[]} array
			*/
			const bubbleSort = (array) => {
				array = [...array];
				for (let i = array.length; i > 1; i--) {
					for (let j = 0; j < i - 1; j++) {
						if (array[j] > array[j + 1]) {
							const v = array[j + 1];
							array[j + 1] = array[j];
							array[j] = v;
						}
					}
				}

				return array;
			}
